import {Axios} from "@/services/axios.js"

export default{
     RegisterUser(data){
        try {
            Axios.post('users',data)
        } catch (error) {
            console.log(error)
        }
    },

     LoginUser(data){
        try {
             Axios.post('auth/login',data)
            .then(reponse => {
                return {data: reponse.data}
            })
        } catch (error) {
            console.log(error)
        }
    }
}
